import React from 'react'
import styled from 'styled-components'

const UserPicture = styled.div`
height: 50px;
width: 50px;
border: 50%;
background-color: purple;
`


export default function UserPic() {
  return (
    <UserPicture>UserPic</UserPicture>
  )
}
